import React,{useState,useEffect} from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView,KeyboardAvoidingView,Picker,TextInput,Platform,ScrollView,Image} from 'react-native';
import {css} from '../assets/Css/css';
import rsi from '../assets/rsi.png';
import macd from '../assets/macd.png'
import beta from '../assets/beta.png'
import predicao from '../assets/predicao.png'
import close from '../assets/close.png'

export default function Preditor2 ({route}) {
    const[result,setResult] = useState(route.params?.transf.data[0].val_fuzz)
    return (
        <SafeAreaView style = {css.fundo}>
            <View> <Text>{result}</Text></View>
            <View> <Image style = {{width: 200, height: 200}} source = {rsi}/></View>
            <View> <Image style = {{width: 200, height: 200}} source = {macd}/></View>
            <View> <Image style = {{width: 200, height: 200}} source = {beta}/></View>
            <View> <Image style = {{width: 200, height: 200}} source = {predicao}/></View>
            <View> <Image style = {{width: 200, height: 200}} source = {close}/></View>
        </SafeAreaView>
    );
    
}
